class Footer extends React.Component {
	render() {
		return (
			<div className='flex justify-center border-t-2 z-100 bottom-0 inset-x-0'>
				<p className='text-center text-gray-500 text-xs mt-2 h-10'>
					2020 SMU EBS G1T3.
				</p>
			</div>
		);
	}
}
export default Footer;
